import React from "react";
import { Route, Switch } from "react-router-dom";
import About from "./pages/About";
import Skills from "./pages/Skills";
import MapsPage from "./pages/Skills";
import Contact from "./pages/Contact";

const Routes = () => {
  return (
    <Switch>
      <Route path="/dashboard/about" component={ProfilePage} />
      <Route path="/dashboard/skills" component={Skills} />
      <Route path="/dashboard/maps" component={MapsPage} />
      <Route path="/dashboard/contact" component={Contact} />
    </Switch>
  );
};

export default Routes;
